AutoroutePartSettings.Pattern:
{% assign parent_segments = ContentItem.Content.CategoryPart.Category.TermContentItemIds[0]
| inherited_terms: ContentItem.Content.CategoryPart.Category.TaxonomyContentItemId | reverse 
%}

{% for seg in parent_segments %}
    {% if parent_segments.last != seg %}
{{ seg.DisplayText | downcase | slugify | append: '/' }}
    {% else %}
{{ ContentItem.DisplayText | downcase | slugify }}
    {% endif %}
{% endfor %}

HtmlBodyPartTrumbowygEditorSettings.Options:
{
    autogrow: true,
    btns: [
        ["viewHTML"],
        ["undo", "redo"],
        ["formatting"],
        ["strong", "em", "del"],
        ["foreColor", "backColor"],
        ["superscript", "subscript"],
        ["link"],
        ["image"],
        ["align"],
        ["unorderedList", "orderedList"],
        ["horizontalRule"],
        ["removeformat"],
        ["fullscreen"]
    ],
    btnsDef: {
        align: {
            dropdown: ["justifyLeft", "justifyCenter", "justifyRight", "justifyFull"],
            ico: "justifyLeft"
        },
        image: {
            dropdown: ["insertImage", "base64", "noembed"],
            ico: "insertImage"
        }
    }
}

